   hczToken = MyCoin(_tokenAddress); // 初始化，绑定已部署的 MyCoin 合约\\\\n   }\\\\n   // 接收 ETH 并兑换代币\\\\n    receive() external payable {\\\\n        buyTokens();\\\\n    }\\\\n    // 用ETH购买代币\\\\n    function buyTokens() public payable {\\\\n        require(msg.value > 0, \\\\\"Send ETH to buy tokens\\\\\");\\\\n\\\\n        uint256 tokenAmount = msg.value * rate;\\\\n\\\\n        require(hczToken.balanceOf(address(this)) >= tokenAmount, \\\\\"Not enough tokens in the contract\\\\\"); //账户余额不能少于用户要买的代币\\\\n\\\\n        hczToken.transfer(msg.sender, tokenAmount);\\\\n    }\\\\n     // 查询合约从 owner 被授权的额度\\\\n    function allowance() public view returns (uint256) {\\\\n        return hczToken.allowance(owner, address(this));\\\\n    }\\\\n    // 提现功能（只允许 owner）\\\\n    function withdraw() public {\\\\n        require(msg.sender == owner, \\\\\"Only owner can withdraw\\\\\");\\\\n        payable(owner).transfer(address(this).balance);\\\\n    }\\\\n}\\\\n\\\\n\",\"sourcePath\":\"D:\\\\\\\\hcz项目\\\\\\\\web3\\\\\\\\端午\\\\\\\\course-truffle-contract\\\\\\\\hcz-truffle-course-version\\\\\\\\contracts\\\\\\\\ExchangeETH.sol\",\"ast\":{\"absolutePath\":\"project:/contracts/ExchangeETH.sol\",\"exportedSymbols\":{\"Context\":[711],\"ERC20\":[586],\"ExchangeETH\":[1080],\"IERC20\":[664],\"IERC20Metadata\":[689],\"MyCoin\":[1122]},\"id\":1081,\"license\":\"MIT\",\"nodeType\":\"SourceUnit\",\"nodes\":[{\"id\":967,\"literals\":[\"solidity\",\"^\",\"0.8\",\".21\"],\"nodeType\":\"PragmaDirective\",\"src\":\"32:24:5\"},{\"absolutePath\":\"project:/contracts/MyCoin.sol\",\"file\":\"./MyCoin.sol\",\"id\":968,\"nameLocation\":\"-1:-1:-1\",\"nodeType\":\"ImportDirective\",\"scope\":1081,\"sourceUnit\":1123,\"src\":\"57:22:5\",\"symbolAliases\":[],\"unitAlias\":\"\"},{\"abstract\":false,\"baseContracts\":[],\"canonicalName\":\"ExchangeETH\",\"contractDependencies\":[],\"contractKind\":\"contract\",\"fullyImplemented\":true,\"id\":1080,\"linearizedBaseContracts\":[1080],\"name\":\"ExchangeETH\",\"